import time
import sys

def show_animation():
    """
    Display the startup animation sequence.
    Shows ARGUS animated logo.
    """
    for frame in CUSTOM_ANIMATION:
        sys.stdout.write('\r' + frame)
        sys.stdout.flush()
        time.sleep(0.1)
    print("\n")

